// src/components/Property.js
import React from 'react';
import './Property.css'; // Make sure to create a corresponding CSS file

const Property = ({ id, price, beds, wc, area, ketchen, furnished, city, district, width, length }) => {
  return (
    <div className='property-card'>
      <img src={`path_to_image_directory/${id}.jpg`} alt="Property" className='property-image' />
      <div className='property-details'>
        <h3>{city}</h3>
        <p>{district}</p>
        <div className='property-info'>
          <p>Beds: {beds}</p>
          <p>Price: {price}</p>
          {/* Add more details as necessary */}
        </div>
        <button className='invest-button'>Invest Now</button>
      </div>
    </div>
  );
};

export default Property;
